import axios from "axios";

export const GET_PROJECTS = "GET_PROJECTS";

export const getProjects = () => (dispatch) => {
  axios()
    .get("http://localhost:4000/api/projects/organized")
    .then((res) => {
      dispatch({ type: GET_PROJECTS, payload: res.data });
    });
};
